// Refresh only case study sliders on resize
function refreshCaseStudySliders() {
  const caseStudySliders = document.querySelectorAll('.maiden_div .slider, .takao_div .slider-2');
  
  caseStudySliders.forEach(slider => {
    // Trigger Webflow slider refresh
    if (window.Webflow && window.Webflow.require) {
      const sliderModule = window.Webflow.require('slider');
      if (sliderModule && sliderModule.redraw) {
        sliderModule.redraw(slider);
      }
    }
    
    // Alternative: force reflow
    slider.style.display = 'none';
    slider.offsetHeight; // Trigger reflow
    slider.style.display = '';
  });
}

// Debounced resize for case study sliders
let caseStudyResizeTimeout;
window.addEventListener('resize', function() {
  clearTimeout(caseStudyResizeTimeout);
  caseStudyResizeTimeout = setTimeout(refreshCaseStudySliders, 250);
});
// Force Webflow slider refresh when case study popups open
function refreshCaseStudySlider(sliderElement) {
  if (window.Webflow && window.Webflow.require) {
    const sliderModule = window.Webflow.require('slider');
    if (sliderModule && sliderModule.redraw) {
      setTimeout(() => {
        sliderModule.redraw(sliderElement);
      }, 50);
    }
  }
}

// Listen for when case study popups open (you might need to adjust this based on your Webflow interactions)
document.addEventListener('DOMContentLoaded', function() {
  // This is a generic approach - you might need more specific targeting
  const caseStudyTriggers = document.querySelectorAll('[data-w-id="f2a9605a-bab0-0124-e7f0-e18e63ccf306"], [data-w-id="fe809899-ef34-3d78-edc1-e4ead4388f6c"]');
  
  caseStudyTriggers.forEach(trigger => {
    trigger.addEventListener('click', function() {
      setTimeout(() => {
        const slider = this.querySelector('.slider, .slider-2');
        if (slider) {
          refreshCaseStudySlider(slider);
        }
      }, 100);
    });
  });
});
// Completely reset Webflow sliders on resize
function resetWebflowSliders() {
  const sliders = document.querySelectorAll('.maiden_div .slider, .takao_div .slider-2');
  
  sliders.forEach(slider => {
    if (slider && window.Webflow && window.Webflow.require) {
      try {
        // Force complete slider reset
        const sliderModule = window.Webflow.require('slider');
        if (sliderModule && sliderModule.destroy && sliderModule.redraw) {
          // Destroy and recreate the slider
          sliderModule.destroy(slider);
          setTimeout(() => {
            sliderModule.redraw(slider);
          }, 50);
        }
      } catch (e) {
        console.log('Webflow slider reset error:', e);
      }
    }
  });
}

// Use a debounced resize handler
let webflowResizeTimer;
window.addEventListener('resize', function() {
  clearTimeout(webflowResizeTimer);
  webflowResizeTimer = setTimeout(resetWebflowSliders, 300);
});

// Also reset on orientation change
window.addEventListener('orientationchange', function() {
  setTimeout(resetWebflowSliders, 500);
});
