document.addEventListener('DOMContentLoaded', function() {
    const navLinks = document.querySelectorAll('a[href^="#"]');
    const navbar = document.querySelector('.navbar-copy');
    let isFirstClick = true;
    
    navLinks.forEach(link => {
        link.addEventListener('click', function(e) {
            e.preventDefault();
            const targetId = this.getAttribute('href');
            const targetElement = document.querySelector(targetId);
            
            if (targetElement) {
                // ALWAYS make navbar black immediately on menu click
                navbar.style.backgroundColor = '#000';
                navbar.style.transition = 'background-color 0.1s'; // Quick transition
                
                if (isFirstClick) {
                    // First click - instant scroll
                    targetElement.scrollIntoView();
                    isFirstClick = false;
                } else {
                    // Subsequent clicks - smooth scroll
                    targetElement.scrollIntoView({
                        behavior: 'smooth',
                        block: 'start'
                    });
                }
                
                // After scrolling, let Webflow take over again for future scrolls
                setTimeout(() => {
                    navbar.style.transition = ''; // Restore original transition
                }, 500);
            }
        });
    });
    
});

